export default StyleSheet.create({

    top:{
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        margin: 5,
        borderColor: 'black',
        borderWidth: 1,
    },
    box:{
        margin: 5,
        borderColor: 'black',
        borderWidth: 1,
    },
    txt:{
        fontWeight: 'bold',
    }
})
